    "",ntt"description": "Section 498(c) of the Higher Education Act of 1965,
    as amended, requires for-profit and non-profit institutions to annually submit audited
    financial statements to the Department to demonstrate they are maintaining the standards
    of financial responsibility necessary to participate in the Title IV programs. One
    of many standards, which the Department utilizes to gauge the financial responsibility
    of an institution, is a composite of three ratios derived from an institution's
    audited financial statements. The three ratios are a primary reserve ratio, an equity
    ratio, and a net income ratio. These ratios gauge the fundamental elements of the
    financial health of an institution, not the educational quality of an institution.",ntt"format":
    "",ntt"tracking_summary": {nttt"total": 24,nttt"recent": 1ntt},ntt"mimetype_inner":
