    "",ntt"description": "Section 487(d)(4) of the Higher Education Act of 1965
    (HEA), as amended, requires the Secretary to annually submit a report to Congress
    containing information regarding the amount and percentage of each proprietary institution's
    revenues from Title IV sources and non-Title IV sources as provided by the institution
    in its audited financial statements. The reports are sent to the Chairmen and Ranking
    Members of the corresponding House and Senate authorizing committees. Below, you
    can access the 90/10 transmittal letters, summary charts and reports for institutions
    with fiscal years ending in the corresponding award year.",ntt"format": "",ntt"tracking_summary":
