    "2016-11-25T21:05:57.743404",nt"name": "annual-submission-of-financial-statements-and-compliance-audits-2012-13",nt"isopen":
    true,nt"url": null,nt"notes": "The Annual Submission of Financial Statements
    and Compliance Audits, 2012-13 (ASFS 2012-13), is a study that is part of the Annual
    Submission of Financial Statements and Compliance Audits program. ASFS 2012-13 is
    a cross-sectional survey that collects data from postsecondary institutions in the
    form of annual audited financial statements. The study was conducted using a web-based
    data collection system where postsecondary institutions submitted information. The
    universe of postsecondary schools was sampled. The study's response rate was 100
    percent. Key statistics produced from ASFS 2012-13 are on the disbursement of Title
    IV funding, compliance to federal regulations regarding Title IV funding, and overall
    financial health of institutions.",nt"license_title": "Creative Commons CCZero",nt"extras":
